void Display_Picture()
{
	/* Set the rotation that fit the image */
	ILI9341_Set_Rotation(1);

	/* Drawing Image to the LCD */
	uint64_t k = 0;
	for(uint32_t i = 0; i < 240; i++)
	{
		for(uint32_t j = 320; j > 0; j--)
		{
			ILI9341_Draw_Pixel(i, j, gImage_PicTest[k]);
			k++;
		}
	}
}

